pragma solidity ^0.5.0;

import "../interfaces/IProxyStorage.sol";
import "../interfaces/IEternalStorageProxy.sol";
import "./EternalStorage.sol";
import "../misc/Ownable.sol";


contract ProxyStorage is EternalStorage, IProxyStorage, Ownable {

    bytes32 internal constant INIT_DISABLED =
        keccak256("initDisabled");

    bytes32 internal constant ADDRESS_MANAGER_ETERNAL_STORAGE =
        keccak256("addressManagerEternalStorage");

    bytes32 internal constant POA_VALIDATOR_SET =
        keccak256("poaValidatorSet");

    bytes32 internal constant REWARD_BY_BLOCK_ETERNAL_STORAGE = 
        keccak256("rewardByBlockEternalStorage");

    bytes32 internal constant VALIDATOR_METADATA_ETERNAL_STORAGE =
        keccak256("validatorMetadataEternalStorage");

    enum ContractTypes {
        Invalid,
        AddressManager,
        PoaValidatorSet,
        RewardByBlock
    }

    event ProxyInitialized(
        address addressManagerEternalStorage,
        address rewardByBlockEternalStorage
    );

    event AddressSet(uint256 contractType, address contractAddress);

    function initDisabled() public view returns(bool) {
        return boolStorage[INIT_DISABLED];
    }

    function init(address _poaValidatorSet) public onlyOwner {
        require(!initDisabled(), "Initialization is already disabled.");
        require(_poaValidatorSet != address(0), "Validator contract address cannot be 0x0.");
        require(_poaValidatorSet != address(this), "Validator contract address cannot be the same as this.");
        _setPoaValidatorSet(_poaValidatorSet);
        boolStorage[INIT_DISABLED] = true;
    }

    function getAddressManager() public view returns(address) {
        return addressStorage[ADDRESS_MANAGER_ETERNAL_STORAGE];
    }

    function getPoaValidatorSet() public view returns(address) {
        return addressStorage[POA_VALIDATOR_SET];
    }

    function getRewardByBlock() public view returns(address) {
        return addressStorage[REWARD_BY_BLOCK_ETERNAL_STORAGE];
    }

    function initializeAddresses(
        address _addressManagerEternalStorage,
        address _rewardByBlockEternalStorage
    ) 
        public 
        onlyOwner
    {
        addressStorage[ADDRESS_MANAGER_ETERNAL_STORAGE] = 
            _addressManagerEternalStorage;

        addressStorage[REWARD_BY_BLOCK_ETERNAL_STORAGE] = 
            _rewardByBlockEternalStorage;

        emit ProxyInitialized(
            _addressManagerEternalStorage,
            _rewardByBlockEternalStorage
        );
    }

    function setContractAddress(uint256 _contractType, address _contractAddress)
        public
        returns(bool)
    {
        if (!initDisabled()) {
            return false;
        }

        if (_contractAddress == address(0)) {
            return false;
        }

        bool success = false;

        if (_contractType == uint256(ContractTypes.AddressManager)) {
            success = IEternalStorageProxy(
                getAddressManager()
            ).upgradeTo(_contractAddress);
        } else if (_contractType == uint256(ContractTypes.PoaValidatorSet)) {
            _setPoaValidatorSet(_contractAddress);
            success = true;
        } else if (_contractType == uint256(ContractTypes.RewardByBlock)) {
            success = IEternalStorageProxy(
                getRewardByBlock()
            ).upgradeTo(_contractAddress);
        }

        if (success) {
            emit AddressSet(_contractType, _contractAddress);
        }

        return success;
    }

    function _setPoaValidatorSet(address _poaValidatorSet) private {
        addressStorage[POA_VALIDATOR_SET] = _poaValidatorSet;
    }
}
